import net.sf.json.groovy.*;

def items = context.expand( '${Display product confirmation business interaction items and return items#res_items}' )
def serializedProductId = context.expand( '${Create initial data and products that are serialized,serialized without range and nonserialized#serializedProductId}' )
def serializedWithoutRangeProductId = context.expand( '${Create initial data and products that are serialized,serialized without range and nonserialized#serializedWithoutRangeProductId}' )
def nonSerializedProductId = context.expand( '${Create initial data and products that are serialized,serialized without range and nonserialized#nonSerializedProductId}' )

def json = new JsonSlurper().parseText (items);

for (int i=0; i < json.size(); i++){

	if (json[i].productId == serializedProductId ) {
		//return json[i].id;
testRunner.testCase.testSteps['Properties'].setPropertyValue("SerializedNewProductId",json[i].id.toString());

										}

	if (json[i].productId == serializedWithoutRangeProductId ) {
		//return json[i].id;
testRunner.testCase.testSteps['Properties'].setPropertyValue("SerializedWithoutRangeNewProductId",json[i].id.toString());

										}

	if (json[i].productId == nonSerializedProductId ) {
		//return json[i].id;
testRunner.testCase.testSteps['Properties'].setPropertyValue("NonSerializedNewProductId",json[i].id.toString());																		
}}

